Gebaseerd op een waargebeurd verhaal van een Tweede Wereldoorlog veteraan en familieman die verandert in een bankovervaller. Gedesillusioneerd door zijn naoorlogse omstandigheden zit Eddie Boyd gevangen tussen de noodzaak om voor zijn gezin te zorgen en en het najagen van zijn onvervulde droom om naar Hollywood te vertrekken en een ster te worden. Hij ontdekt echter een manier om beide te doen door banken te beroven, in Hollywood-stijl.



